# Eq in std::cmp - Rust

## Trait [std](../index.html)::[cmp](index.html)::[Eq](#)

1.0.0 · [source](https://doc.rust-lang.org/1.80.0/src/core/cmp.rs.html#329) ·

```
pub trait Eq: PartialEq { }
```

Expand description

Trait for comparisons corresponding to [equivalence relations](https://en.wikipedia.org/wiki/Equivalence_relation).

This means, that in addition to `a == b` and `a != b` being strict inverses, the relation must be (for all `a`, `b` and `c`):

-   reflexive: `a == a`;
-   symmetric: `a == b` implies `b == a` (required by `PartialEq` as well); and
-   transitive: `a == b` and `b == c` implies `a == c` (required by `PartialEq` as well).

This property cannot be checked by the compiler, and therefore `Eq` implies [`PartialEq`](trait.PartialEq.html "trait std::cmp::PartialEq"), and has no extra methods.

Violating this property is a logic error. The behavior resulting from a logic error is not specified, but users of the trait must ensure that such logic errors do _not_ result in undefined behavior. This means that `unsafe` code **must not** rely on the correctness of these methods.

Implement `Eq` in addition to `PartialEq` if it’s guaranteed that `PartialEq::eq(a, a)` always returns `true` (reflexivity), in addition to the symmetric and transitive properties already required by `PartialEq`.

### [§](#derivable)Derivable

This trait can be used with `#[derive]`. When `derive`d, because `Eq` has no extra methods, it is only informing the compiler that this is an equivalence relation rather than a partial equivalence relation. Note that the `derive` strategy requires all fields are `Eq`, which isn’t always desired.

### [§](#how-can-i-implement-eq)How can I implement `Eq`?

If you cannot use the `derive` strategy, specify that your type implements `Eq`, which has no methods:

```
enum BookFormat { Paperback, Hardback, Ebook }
struct Book {
    isbn: i32,
    format: BookFormat,
}
impl PartialEq for Book {
    fn eq(&self, other: &Self) -> bool {
        self.isbn == other.isbn
    }
}
impl Eq for Book {}
```

